import React from 'react'
import BH from "../../../../assets/img/home/bh.jpg";

function Card() {
	<div class="max-w-sm bg-white border border-gray-400 rounded-lg shadow ">
		<img class="bg-cover rounded-t-lg" src={BH} alt=""></img>
		<div class="p-5">
			<a>
				<h5
				 class="mb-2 text-2xl font-bold tracking-tight text-gray-900">Noteworthy
					technology acquisitions 2021</h5>
			</a>
			<p class="mb-3 font-normal text-gray-700 ">Here are the biggest
				enterprise technology acquisitions of 2021 so far, in reverse chronological
				order.</p>
		</div>
	</div>
}

function Cards() {
	const cards = [];
	for (let i = 0; i < 4; i++) {
		cards.push(<Card key={i} />);
	}

	return (
		<div className="flex items-center justify-center flex-wrap mx-auto pb-20">
			<div className="container">
				<div className="flex flex-col items-center justify-center">
					<div className="flex gap-28 flex-row media-fd items-center justify-center">
						{cards}
					</div>
				</div>
			</div>
		</div>
	);
}

export default Cards;
